import React from 'react';
import { useEffect, useState } from 'react';
import axios from 'axios';
import { useNavigate } from 'react-router-dom';
import MainLayout from '../components/MainLayout.tsx';
import StreakChart from '../components/StreakChart.tsx';

interface ReadingEvent {
  id: number;
  post_id: string;
  created_at: string;
}

const Dashboard = () => {
  const userEmail = localStorage.getItem('userEmail') || '';
  const [error, setError] = useState<string | null>(null);
  const [userData, setUserData] = useState<{
    email: string;
    isAdmin: boolean;
    streak: number;
    maxStreak: number;
    streakHistory: number[]
    events: ReadingEvent[];
  } | null>(null);
  const navigate = useNavigate();

  console.log('data', userData);

  useEffect(() => {
    const fetchData = async () => {
      try {
        const email = localStorage.getItem('userEmail');
        console.log('Email do localStorage:', email);

        if (!email) {
          console.error('Email n√£o encontrado');
          // replace para evitar loop de navega√ß√£o
          navigate('/', { replace: true });
          return;
        }

        const response = await axios.get('http://localhost:3001/api/user/stats', {
          params: { email }
        });
        console.log('Resposta da API:', response.data);

        // üëá For√ßar tipagem para evitar erros de estrutura
        if (!response.data || !response.data.email) {
          throw new Error('Dados inv√°lidos');
        }

        setUserData(response.data);

      } catch (error: any) {
        console.error('Erro:', error);
        setError(
          error.response?.data?.error || 
          'Erro ao carregar dados. Tente novamente.'
        );
      }
    };

    fetchData();
  }, [navigate]);
  console.log('tres', userData);
  console.log('data2',userEmail);

  if (error) {
    return (
      <MainLayout userEmail={userEmail}>
        <div className="error-container">
          <p>{error}</p>
          <button onClick={() => navigate('/')}>Voltar ao Login</button>
        </div>
      </MainLayout>
    );
  }

  if (!userData) return (
    <div className="loading-container">
      <div className="spinner"></div>
      <p>Carregando suas estat√≠sticas...</p>
    </div>
  );

  return (
    <MainLayout userEmail={userData.email}>
    <div className="dashboard container">
      <h1>Bem-vindo, {userData.email}</h1>
      <div className="streak-container">
        <h2>Seu Streak: {userData.streak} dias üî•</h2>
        <p>Mantenha a sequ√™ncia para ganhar recompensas!</p>
      </div>

      <div className="history">
        <h3>Hist√≥rico de Leituras</h3>
        <ul>
          {userData.events.map((event) => (
            <li key={event.id}>
              {new Date(event.created_at).toLocaleDateString()} - Edi√ß√£o #{event.post_id}
            </li>
          ))}
        </ul>
      </div>

        <div className="streak-metrics">
          <div className="metric-box">
            <h3>Streak Atual</h3>
            <div className="metric-value">{userData.streak} üî•</div>
          </div>

          <div className="metric-box">
            <h3>Maior Streak</h3>
            <div className="metric-value">{userData.maxStreak} üèÜ</div>
          </div>

          <div className="chart-container">
            <StreakChart streakHistory={userData.streakHistory} />
          </div>
        </div>

      {userData.isAdmin && (
        <div className="admin-panel">
          <h2>Painel Administrativo</h2>
          {/* Se der tempo lembrar de colocar os gr√°ficos e as m√©ticas aqui */}
        </div>
      )}

          {/* <button
              onClick={() => {
                  localStorage.removeItem('token');
                  window.location.href = '/';
              }}
          >
              Sair
          </button> */}
      </div>
      </MainLayout>
  );
};

export default Dashboard;
